import React from 'react'

import './Register.css';

function Register() {
  return (
    <div className='register'>
        <div className='heading'>Register here!</div>
        <form className="register-form">
            <label className='register-form-label'>Email</label>
            <input className='register-form-input' type="text" name="userEmail" placeholder='emusk@twitter.com'/>
            <label className='register-form-label'>NickName</label>
            <input className='register-form-input' type="text" name="userName" placeholder='Musk'/>
            <label className='register-form-label'>Password</label>
            <input className='register-form-input' type="password" name="userPassword" />
        </form>
    </div>
  )
}

export default Register;
